drop table if exists t_idcard_area;
create table t_idcard_area(
	`id` int(10) primary key comment '身份证前x位',
  `code` varchar(12) COMMENT '编码',
  `name` varchar(28) COMMENT '省市信息',
  `parent_id` int(10) COMMENT '父id',
  `level` tinyint(3) COMMENT '1:省, 2:市, 3:县',
  UNIQUE key uniq_code(`code`) using BTREE,
  index idx_parent_id (parent_id) using BTREE,
  index idx_level(`level`) using BTREE
) ENGINE = INNODB DEFAULT CHARSET=utf8 COMMENT = '身份证地址信息';

